ghiệp, hình ảnh giàu cảm xúc và tính thẩm mỹ và trải nghiệm Leica đầy đủ được thể hiện trong một thiết bị để kết nối những huyền thoại hình ảnh cách đây cả thế kỷ và các tuyệt tác mà bạn đang tạo ra ngày nay.','2023-03-16 16:10:41.873000','2023-05-29 10:08:49.837000','2023-03-16 16:10:58.820000',1,1,8900000.00,987,NULL),(13,'Xiaomi 13','Kiến tạo tuyệt tác tiếp theo của bạn với camera đặc biệt được trang bị ở mặt lưng của Dòng Xiaomi 13. Ẩn sau tuyệt tác này là một hệ thống camera được thiết kế cùng với Leica, được tinh chỉnh để kết hợp các tính năng mang tính biểu tượng như ống kính tele 75mm của Leica, vốn là một mẫu thiết kế mang phong cách cổ điển và thẩm mỹ của Leica.','2023-03-16 16:14:42.114000','2023-05-29 10:08:49.885000','2023-03-16 16:14:43.313000',1,1,7600000.00,454,NULL),(14,'Xiaomi 12T','Siêu khoảnh khắc, siêu hình ảnh\nVới camera chính siêu sắc nét cung cấp độ phân giải cao hàng đầu 108MP, chiếc điện thoại thông minh này được trang bị nhiều thành phần nâng cấp quang học và các tính năng quay chụp ban đêm tốt nhất để mang đến cho bạn những khung cảnh tuyệt đẹp mới, cả ngày lẫn đêm.','2023-03-16 16:16:01.725000','2023-03-16 16:16:03.446000','2023-03-16 16:16:03.441000',1,1,5900000.00,850,NULL),(15,'Xiaomi 12 Pro','Bậc thầy điện ảnhLiên tục phát triển trên hành trình tạo ra sản phẩm phù hợp nhất với mong muốn của khách hàng, Xiaomi 12 Pro giờ đây đã sẵn sàng biến mọi khung hình thành tuyệt tác nhờ bộ ba camera 50MP chuyên nghiệp, màn hình WQHD+ động 120Hz, chipset Snapdragon® 8 Gen 1 tiên tiến nhất và bộ sạc nhanh HyperCharge 120W thông minh của Xiaomi.','2023-03-16 16:16:51.113000','2023-03-27 13:42:58.466000','2023-03-16 16:16:53.080000',1,1,6100000.00,599,NULL),(16,'Redmi A1','Stylish and \ntrendy design\nRedmi A1 comes with a trendy flat frame design available in soothing shades of black, green, and blue color. The textured back panel has a premium look that resists fingerprint smudges and is comfortable to hold for a long period of time.','2023-03-16 16:18:35.289000','2023-03-24 16:49:08.709000','2023-03-16 16:18:37.834000',1,1,4900000.00,410,NULL),(17,'ProArt Studiobook','ProArt Studiobook is the best laptop for professional creators, with ultimate performance, professional-grade graphics and a color-accurate wide-gamut display','2023-03-16 16:25:40.787000','2023-03-16 16:25:53.781000','2023-03-16 16:25:53.772000',1,1,19999999.00,199,NULL),(18,'ASUS Zenbook Pro 16X OLED (UX7602)','Windows 11 Pro - ASUS recommends Windows 11 Pro for business\nASUS Supernova SoM design\n13th gen Intel® Core™ i9-13905H processor\nNVIDIA® GeForce® RTX 4080\n32 GB LPDDR5X RAM and 2 TB SSD storage\n16\" 3.2K 120Hz OLED NanoEdge display\nLong-lasting 96 Wh battery\nASUS Dial','2023-03-16 16:26:52.929000','2023-03-16 16:26:53.868000','2023-03-16 16:26:53.863000',1,1,24000000.00,95,NULL),(19,'Zenbook Pro Duo 15 OLED (UX582, 12th Gen Intel)','Windows 11 Home - ASUS recommends Windows 11 Pro for business\nUp to 15.6\" 4K OLED NanoEdge display\nUp to 12th Intel® Core™ i9 processor\nUp to NVIDIA® GeForce RTX 3070Ti\nUp to 32 GB memory\nUp to 1 TB SSD storage\nNanoEdge 93% screen-to-body ratio\nDCI-P3: 100%','2023-03-16 16:27:42.327000','2023-03-24 15:52:01.881000','2023-03-16 16:27:43.798000',1,1,22900000.00,599,NULL),(20,'Zenbook Pro 15 (UX535)','Windows 10 Pro - ASUS recommends Windows 10 Pro for business, Free Upgrade to Windows 11¹ (when available, see below)\nUp to 10th Gen Intel® Core i7 processor\nUp to NVIDIA® GeForce® GTX 1650 Ti\nUp to 16 GB memory\nUp to 1 TB PCIe SSD storage\nUp to 4K UHD OLED NanoEdge display\nScreenPad™\nTouchscreen','2023-03-16 16:30:18.830000','2023-03-24 16:49:08.676000','2023-03-16 16:30:20.235000',1,1,18900000.00,125,NULL),(21,'ASUS Marshmallow Mouse MD100','The compact ASUS Marshmallow Mouse MD100 adds a dash of vibrancy to your day with its quick-switch magnetic covers, and a handy strap that makes it easy to carry around. For safety and better hygiene, the covers include ASUS Antimicrobial Guard treatment to inhibit the growth of harmful bacteria. ASUS Marshmallow Mouse MD100 also offers easily adjustable DPI levels for varying degrees of precision, plus 100% PTFE mouse feet for a smooth glide on any flat surface.','2023-03-16 16:33:32.104000','2023-03-16 16:33:34.496000','2023-03-16 16:33:34.467000',1,1,490000.00,630,NULL),(22,'ProArt Mouse MD300','ProArt Mouse is the first ASUS mouse that works with ASUS Dial. The fully customizable ProArt Mouse works seamlessly with ASUS Dial, allowing creators to quickly and easily make precise settings adjustments. It also has a side scroll wheel and a large, independent middle key with an integrated gaming-graded switch. The key is rated to up to 50 million clicks and provides the same solid feel for both left- and right-side clicks.','2023-03-16 16:34:11.380000','2023-03-16 16:34:12.887000','2023-03-16 16:34:12.882000',1,1,599000.00,306,NULL),(23,'ASUS Wireless Keyboard and Mouse Set CW100','Keyboard and mouse feature a power-saving technology that prolongs their own batteries and a single 2.4 GHz nano transceiver, creating ultimate convenience and reliable operation.','2023-03-16 16:35:06.375000','2023-03-16 16:35:07.402000','2023-03-16 16:35:07.394000',1,1,989000.00,1200,NULL),(24,'ASUS MW203 Multi-Device Wireless Silent Mouse','The ergonomic ASUS MW203 Multi-Device Wireless Silent Mouse is designed for long-lasting comfort, making it ideal for all-day use.','2023-03-16 16:35:49.476000','2023-03-16 16:35:50.731000','2023-03-16 16:35:50.726000',1,1,790000.00,125,NULL),(25,'TUF Gaming H1 Wireless','TUF Gaming H1 Wireless headset features a 2.4 GHz connection, 7.1 surround sound with deep bass, a Discord and TeamSpeak-certified microphone, a lightweight and comfortable design, plus compatibility with PCs, PlayStation® 5 and Nintendo Switch™.','2023-03-16 16:38:00.330000','2023-03-16 16:38:01.725000','2023-03-16 16:38:01.715000',1,1,790000.00,500,NULL),(26,'ROG Strix Go Core Moonlight White ','ROG Strix Go Core Moonlight White gaming headset delivers immersive gaming audio and incredible comfort, and supports PC, Mac, mobile phones, PlayStation® 5, Xbox® Series X and S, and Nintendo Switch™','2023-03-16 16:38:42.901000','2023-03-16 16:38:44.053000','2023-03-16 16:38:44.041000',1,1,750000.00,250,NULL),(27,'iPhone 14 Pro','Brighter 6.1” Super Retina XDR display¹ featuring Always-On, which keeps your info at a glance\nDynamic Island, a magical new way to interact with iPhone','2023-03-16 16:42:15.609000','2023-03-16 16:42:17.088000','2023-03-16 16:42:17.080000',1,1,41900000.00,532,NULL),(28,'iPhone 13','6.1-inch Super Retina XDR display¹\nA15 Bionic with 4-core GPU for lightning-fast performance\nAdvanced dual-camera system for incredible low-light photos and videos','2023-03-16 16:44:34.578000','2023-03-16 16:44:35.983000','2023-03-16 16:44:35.978000',1,1,25000000.00,530,NULL),(29,'iPhone 14','Advanced dual-camera system for incredible low-light photos and videos\n\nAs part of our efforts to reach carbon neutrality by 2030, iPhone 14 and iPhone 14 Plus do not include a power adapter or EarPods. Included in the box is a USB‑C to Lightning Cable that supports fast charging and is compatible with USB‑C power adapters and computer ports.\n\nWe encourage you to re‑use your current USB‑A to Lightning cables, power adapters, and headphones, which are compatible with these iPhone models. But if you need any new Apple power adapters or headphones, they are available for purchase.','2023-03-16 16:45:41.282000','2023-03-16 16:45:42.524000','2023-03-16 16:45:42.515000',1,1,32000000.00,123,NULL),(32,'tessss','tessss','2023-03-29 16:04:22.879000','2023-03-29 16:04:22.879000','2023-03-29 16:04:22.869000',NULL,NULL,23.00,42,NULL),(33,'test22','test22','2023-03-29 16:44:09.874000','2023-03-29 16:44:09.874000','2023-03-29 16:44:09.853000',NULL,NULL,12.00,23,NULL),(35,'tai nghe',NULL,'2023-05-17 11:24:22.889000','2023-05-17 11:24:22.889000','2023-05-17 11:24:22.850000',NULL,NULL,25.00,20,'<p>qwdswd</p>\n<